import React, { Component } from 'react';
import Navbar from '../components/Navbar';

export default class Home extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <div className="test">

        </div>
        <h1>Here comes my page</h1>
        <h2>Second Header</h2>
        <h3>Third Header</h3>
        <h4>Fourth Header</h4>
        <h5>Fifth Header</h5>
        <p>Where is my font?</p>
      </div>
    )
  }
}
